column8:
標準的なブーム型スタンド。3/8インチ、5/8インチのマイクホルダーに対応する変換ネジが付属します。(出荷時スタンドに取り付けられています。)
<BR>ストレートスタンドとしてもご使用頂けます。
<BR><BR>Height: 1005～1630 mm
<BR>(ストレートスタンドとして使う場合: 905～1530 mm)
<BR>Length (boom): 790 mm,
<BR>Radius(leg): 約360 mm
